import React from "react";
import "./AdminMain.css";
import TextField from "@material-ui/core/TextField";
import { useHistory } from "react-router-dom";
import Button from "@material-ui/core/Button";
export default function AdminMain() {
  const history = useHistory();
  const [tableItems,setTableItems]=React.useState([]);
  const [flag,setFlag]=React.useState(true);
  React.useEffect(()=>{
    fetch("/admin-main", {
      method:"GET",
      cache: "no-cache",
      headers:{
          "content_type":"application/json",
      }
    }
    ).then(response => {
    return response.json()
   })
   .then(json => {
      console.log(json.college_url);
      const arr=[];
      json.college_url.map((item,index)=>{
        arr.push(item[0]);
      })
      setTableItems(arr);
   })
  },[flag]);

  const handleClick = (value,approve) => {
    const val={college_url:value,approve:approve}
    setFlag(!flag)
    fetch("/admin-main", {
      method:"POST",
      cache: "no-cache",
      headers:{
          "content_type":"application/json",
      },
       body:JSON.stringify(val)
      }
    ).then(response => {
    return response.json()
   })
   .then(json => {
      console.log(json.status);  
   })
  }
  return (
    <div className="admin-main-body">
      <div className="admin-main-container">
        <div className="admin-main-logo">W</div>
        <h1 className="admin-main-signUp">Admin Main</h1>
        {error.invalidEmail ?
           <TextField
            error
             name="email"
             value={credentials.email}
             label={
               <span style={{ fontFamily: '"Nunito", sans-serif' }}>Email already registered</span>
             }
             onChange={handleChange}
             className="register-email"
             inputProps={{
               min: 0,
               style: { fontFamily: '"Nunito", sans-serif' }
             }}
        />
        :
        <TextField
          name="email"
          value={credentials.email}
          label={
            <span style={{ fontFamily: '"Nunito", sans-serif' }}>Email</span>
          }
          onChange={handleChange}
          className="register-email"
          inputProps={{
            min: 0,
            style: { fontFamily: '"Nunito", sans-serif' }
          }}
        />}

         <TextField
          name="name"
          value={credentials.name}
          label={
            <span style={{ fontFamily: '"Nunito", sans-serif' }}>Your Name</span>
          }
          onChange={handleChange}
          className="register-password"
          style={{marginTop:"20px"}}
          inputProps={{
            min: 0,
            style: { fontFamily: '"Nunito", sans-serif' }
          }}
        />
        <TextField
          name="college"
          value={credentials.college}
          label={
            <span style={{ fontFamily: '"Nunito", sans-serif' }}>College URL</span>
          }
          onChange={handleChange}
          className="register-password"
          style={{marginTop:"20px"}}
          inputProps={{
            min: 0,
            style: { fontFamily: '"Nunito", sans-serif' }
          }}
        />
        <TextField
          name="password"
          value={credentials.password}
          onChange={handleChange}
          style={{ marginTop: "20px" }}
          label={
            <span style={{ fontFamily: '"Nunito", sans-serif' }}>Password</span>
          }
          type="password"
          className="register-password"
          inputProps={{
            min: 0,
            style: { fontFamily: '"Nunito", sans-serif' }
          }}
        />
        { invalidPassword ?
        <TextField
          error
          name="confirmPassword"
          value={credentials.confirmPassword}
          onChange={handleChange}
          style={{ marginTop: "20px" }}
          label={
            <span style={{ fontFamily: '"Nunito", sans-serif' }}>
              Passwords don't match
            </span>
          }
          type="password"
          className="register-password"
          inputProps={{
            min: 0,
            style: { fontFamily: '"Nunito", sans-serif' }
          }}
        />
        :
        <TextField
          name="confirmPassword"
          value={credentials.confirmPassword}
          onChange={handleChange}
          style={{ marginTop: "20px" }}
          label={
            <span style={{ fontFamily: '"Nunito", sans-serif' }}>
              Confirm password
            </span>
          }
          type="password"
          className="register-password"
          inputProps={{
            min: 0,
            style: { fontFamily: '"Nunito", sans-serif' }
          }}
        />}
        <div style={{ width: "85%", marginLeft: "7.5%", marginTop: "40px" }}>
          <Submit disabled={disabled} credentials={credentials}  errorLogging={errorLogging}/>
        </div>
        <div
          onClick={() => {
            history.push("/");
          }}
          className="admin-main-go-home"
          style={{ marginTop: "20px",cursor:"pointer" }}
        >
          Go to home
        </div>
      </div>
    </div>
  );
}
